    wrkCtrCapRes_IntvMth.visible(ctrlStatPeriod.selection()     == ReqPoStatPeriod::Month               ? true : false);
    intvMthName.visible(ctrlStatPeriod.selection()              == ReqPoStatPeriod::Month               ? true : false);

    wrkCtrCapRes_IntvWk.visible(ctrlStatPeriod.selection()      == ReqPoStatPeriod::Week                ? true : false);
    intvWkName.visible(ctrlStatPeriod.selection()               == ReqPoStatPeriod::Week                ? true : false);

    wrkCtrCapRes_TransDate.visible(ctrlStatPeriod.selection()   == ReqPoStatPeriod::ReqDate             ? true : false);

    wrkCtrResourceAndGroupView_WrkCtrId.visible(ctrlStatKey.selection() == WrkCtrStatKey::WrkCtrId      ? true : false);
    wrkCtrResourceAndGroupView_Name.visible(ctrlStatKey.selection()     == WrkCtrStatKey::WrkCtrId ||
                                            ctrlStatKey.selection()     == WrkCtrStatKey::WrkCtrGroupId ? true : false);

    wrkCtrResourceAndGroupView_Name.visible(ctrlStatKey.selection()  == WrkCtrStatKey::WrkCtrGroupId    ? true : false);

    wrkCtrCapRes_RefType.visible(ctrlPerRefType.value()                                                 ? true : false);

    ctrlWrkCtrId.enabled(     ctrlStatKey.selection()           == WrkCtrStatKey::WrkCtrId              ? true : false);
    ctrlWrkCtrGroupId.enabled(ctrlStatKey.selection()           == WrkCtrStatKey::WrkCtrGroupId         ? true : false);
}

