    if ( !reqPlanId )
    {
        reqPlanId = ReqPlanSched::defaultStaticId();
    }

    planFilter.text(reqPlanId);
}

void showGraphics()
{
    WrkCtrCapRes                wrkCtrCapResCache;
    WrkCtrResourceAndGroupView  wrkCtrResourceAndGroupViewCache;
    Integer                     mark;

    Integer     recordNum;

    str         strPeriod;
    str         strKey;
    str         strBase;
    str         lookupValue;
    str         strNumPeriod;

    Map         mapPeriod   = new Map(Types::String,Types::String);
    Map         mapKey      = new Map(Types::String,Types::String);
    Map         mapBase     = new Map(Types::String,Types::Real);

    MapIterator mi;

    #MACROLIB.ChartFx

    if (graphics)
    {
        graphics.closeGraph();
    }

    graphics = Graphics::newGraphicsNoTitlesSysChart(SysChart1, GraphicsTmpData);
    graphics.parmCreateType(#CT_LEGEND);
    graphics.create();

    wrkCtrCapResCache = wrkCtrCapRes_DS.getFirst(1,false);
    wrkCtrResourceAndGroupViewCache = wrkCtrResourceAndGroupView_ds.getFirst(1, false);
    if (! wrkCtrCapResCache.PlanVersion
        && ! element.strKey(wrkCtrCapResCache, wrkCtrResourceAndGroupViewCache)
        && ! element.strPeriod(wrkCtrCapResCache)
        && element.realBase(wrkCtrCapResCache) == 0)
    {
        mark = 0;
    }
    else
    {
        mark = 1;
    }

    graphics.resetGraph();

    // time constants
    int   intvMonthMaxLength  = strlen(int2str(intvno(datemax(), WrkCtrCapRes::intvRefDate(), IntvScale::YearMonth)));
    int   intvWeekMaxLength   = strlen(int2str(intvno(datemax(), WrkCtrCapRes::intvRefDate(), IntvScale::YearWeek)));

    wrkCtrCapResCache = wrkCtrCapRes_DS.getFirst(mark,true);
    wrkCtrResourceAndGroupViewCache = wrkCtrResourceAndGroupView_ds.getFirst(mark, true);
    while (true)
    {
        recordNum++;

        strPeriod   = element.strPeriod(wrkCtrCapResCache);
        strKey      = element.strKey(wrkCtrCapResCache, wrkCtrResourceAndGroupViewCache);
        strBase     = element.realBase(wrkCtrCapResCache) != 0 ? num2str(element.realBase(wrkCtrCapResCache),-1,-1,-1,-1) : '';

        if (! wrkCtrCapResCache.PlanVersion && ! strPeriod && ! strKey && ! strBase)
        {
            break;
        }

        switch (ctrlStatPeriod.selection())
        {
            case ReqPoStatPeriod::Month :
                strNumPeriod =  num2str0(wrkCtrCapResCache.IntvMth, intvMonthMaxLength);
                break;

            case ReqPoStatPeriod::Week :
                strNumPeriod =  num2str0(wrkCtrCapResCache.IntvWk, intvWeekMaxLength);
                break;

            case ReqPoStatPeriod::ReqDate:
                // returned string should date components in sequence: year-month-day
                strNumPeriod =  date2str(wrkCtrCapResCache.TransDate,321,2,-1,2,-1,-1, DateFlags::FormatAll);
                break;

            default:
                strNumPeriod = strPeriod;
        }
        str sortString =strNumPeriod+'#'+strKey+'#'+strBase+'#'+int2str(recordNum);

        mapPeriod.insert(sortString,strPeriod);
        mapKey.insert(sortString, strKey);
        mapBase.insert(sortString,element.realBase(wrkCtrCapResCache));

        wrkCtrCapResCache = wrkCtrCapRes_DS.getNext();
        wrkCtrResourceAndGroupViewCache = wrkCtrResourceAndGroupView_ds.getNext();
    }

    mi = new MapIterator(mapPeriod);
    mi.begin();
    while (mi.more())
    {
        lookupValue = mapPeriod.lookup(mi.key());
        strPeriod = lookupValue ? lookupValue : '\'\'';

        lookupValue = mapKey.lookup(mi.key());
        strKey = lookupValue ? lookupValue : '\'\'';

        graphics.loadData(strPeriod,strKey,mapBase.lookup(mi.key()));

        mi.next();
    }

    graphics.showGraph();
}

