    element.displayFields();
    element.doResearch();
}

TempStr strKey(WrkCtrCapRes _wrkCtrCapRes, WrkCtrResourceAndGroupView _wrkCtrResourceAndGroupView)
{
    TempStr     tempStr;

    switch (ctrlStatKey.selection())
    {
        case WrkCtrStatKey::WrkCtrGroupId:
            tempStr = _wrkCtrResourceAndGroupView.WrkCtrIdGroup;
            break;

        case WrkCtrStatKey::WrkCtrId :
            tempStr = _wrkCtrResourceAndGroupView.WrkCtrId;
            break;
    }

    if (ctrlPerRefType.value())
    {
        if (tempStr)
        {
            tempStr += '/';
        }

        tempStr += enum2str(_wrkCtrCapRes.RefType);
    }

    return tempStr;
}

TempStr strPeriod(WrkCtrCapRes _wrkCtrCapRes)
{
    TempStr tempStr;

    switch (ctrlStatPeriod.selection())
    {
        case ReqPoStatPeriod::Quarter :
            tempStr = _wrkCtrCapRes.IntvQr ? _wrkCtrCapRes.intvQrName() : '';
            break;

        case ReqPoStatPeriod::Month :
            tempStr = _wrkCtrCapRes.IntvMth ? _wrkCtrCapRes.intvMthName() : '';
            break;

        case ReqPoStatPeriod::Week :
            tempStr = _wrkCtrCapRes.IntvWk ? _wrkCtrCapRes.intvWkName() : '';
            break;

        case ReqPoStatPeriod::ReqDate :
            tempStr = _wrkCtrCapRes.TransDate ? date2str(_wrkCtrCapRes.TransDate,321,-1,-1,-1,-1,-1, DateFlags::None) : '';
            break;
    }

    return tempStr;
}

public boolean unpack(container packedClass)
{
    Integer  version     = conpeek(packedClass,1);

    switch (version)
    {
        case #CurrentVersion :
            [version,#CurrentList] = packedClass;
            break;
        default :
            return false;
    }

    this.list2Value();

    return true;
}

