public void executeQuery()
{
    Query                   query;
    QueryBuildDataSource    qbsWrkCtrCapRes;
    QueryBuildDataSource    qbdsWrkCtrResourceAndGroupView;

    str                     dateRange;
    ReqPlanVersion          reqPlanVersionActive =
                                                   ReqPlan::findReqPlanId(reqPlanId).findActiveVersion();

    // Reset query
    query = new Query();

    // WrkCtrCapRes inner joined with WrkCtrResourceAndGroupView to be able to filter/show resource group
    qbdsWrkCtrResourceAndGroupView = query.addDataSource(tablenum(WrkCtrResourceAndGroupView), wrkCtrResourceAndGroupView_ds.name());
    qbsWrkCtrCapRes = qbdsWrkCtrResourceAndGroupView.addDataSource(tablenum(WrkCtrCapRes), wrkCtrCapRes_ds.name());

    qbdsWrkCtrResourceAndGroupView.clearLinks();
    qbdsWrkCtrResourceAndGroupView.clearRanges();

    qbsWrkCtrCapRes.addLink(fieldnum(WrkCtrCapRes,WrkCtrId), fieldnum(WrkCtrResourceAndGroupView, WrkCtrId));

    var queryDateRange = qbdsWrkCtrResourceAndGroupView.addRange(fieldnum(WrkCtrResourceAndGroupView,ValidFrom));
    queryDateRange.value(
            strfmt('(%1.%2 <= %3.%4)',
                    wrkCtrResourceAndGroupView_ds.name(),
                    fieldstr(WrkCtrResourceAndGroupView,ValidFrom),
                    wrkCtrCapRes_ds.name(),
                    fieldstr(WrkCtrCapRes,TransDate))
    );
    queryDateRange.status(RangeStatus::Hidden);

    queryDateRange = qbdsWrkCtrResourceAndGroupView.addRange(fieldnum(WrkCtrResourceAndGroupView,ValidTo));
    queryDateRange.value(
            strfmt('(%1.%2 >= %3.%4)',
                    wrkCtrResourceAndGroupView_ds.name(),
                    fieldstr(WrkCtrResourceAndGroupView,ValidTo),
                    wrkCtrCapRes_ds.name(),
                    fieldstr(WrkCtrCapRes,TransDate))
    );
    queryDateRange.status(RangeStatus::Hidden);

    // Add ranges from form selections
    qbsWrkCtrCapRes.addRange(fieldnum(WrkCtrCapRes,PlanVersion)).value(strfmt("%1,%2",
        queryValue(reqPlanVersionActive.RecId),
        queryValue(0)));

    if (ctrlFromDate.dateValue() != dateNull())
    {
        dateRange = queryValue(ctrlFromDate.dateValue());
    }

    dateRange += '..';

    if (ctrlToDate.dateValue() != dateNull())
    {
        dateRange += queryValue(ctrlToDate.dateValue());
    }

    if (dateRange != '..')
    {
        qbsWrkCtrCapRes.addRange(fieldnum(WrkCtrCapRes,TransDate)).value(dateRange);
    }

    switch (ctrlStatKey.selection())
    {
        case WrkCtrStatKey::WrkCtrGroupId:
            qbdsWrkCtrResourceAndGroupView.addSortField(fieldnum(WrkCtrResourceAndGroupView,WrkCtrIdGroup));
            if (ctrlWrkCtrGroupId.text())
            {
                qbdsWrkCtrResourceAndGroupView.addRange(fieldnum(WrkCtrResourceAndGroupView,WrkCtrIdGroup)).value(queryValue(ctrlWrkCtrGroupId.text()));
            }
            break;

        case WrkCtrStatKey::WrkCtrId :
            qbdsWrkCtrResourceAndGroupView.addSortField(fieldnum(WrkCtrResourceAndGroupView,WrkCtrId));
            qbdsWrkCtrResourceAndGroupView.addSortField(fieldnum(WrkCtrResourceAndGroupView,WrkCtrIdGroup));
            if (ctrlWrkCtrId.text())
            {
                qbdsWrkCtrResourceAndGroupView.addRange(fieldnum(WrkCtrResourceAndGroupView,WrkCtrId)).value(queryValue(ctrlWrkCtrId.text()));
            }
            break;
    }

    switch (ctrlStatPeriod.selection())
    {
        case ReqPoStatPeriod::Quarter :
            qbsWrkCtrCapRes.addSortField(fieldnum(WrkCtrCapRes,IntvQr));
            break;

        case ReqPoStatPeriod::Month :
            qbsWrkCtrCapRes.addSortField(fieldnum(WrkCtrCapRes,IntvMth));
            break;

        case ReqPoStatPeriod::Week :
            qbsWrkCtrCapRes.addSortField(fieldnum(WrkCtrCapRes,IntvWk));
            break;

        case ReqPoStatPeriod::ReqDate :
            qbsWrkCtrCapRes.addSortField(fieldnum(WrkCtrCapRes,TransDate));
            break;
    }

    qbsWrkCtrCapRes.addSortField(fieldnum(WrkCtrCapRes,PlanVersion));

    if (ctrlPerRefType.value())
    {
        qbsWrkCtrCapRes.addSortField(fieldnum(WrkCtrCapRes,RefType));
    }

    qbdsWrkCtrResourceAndGroupView.orderMode(OrderMode::GroupBy);

    qbsWrkCtrCapRes.orderMode(OrderMode::GroupBy);
    qbsWrkCtrCapRes.fields().addField(fieldnum(WrkCtrCapRes,WrkCtrSec),SelectionField::Sum);

    wrkCtrResourceAndGroupView_ds.query(query);

    super();
}

